const handleWidgetStyles = function(ctx){
    const { $container, $containerParent } = ctx;

    const tbTableWidget = $container.find(".tb-table-widget");
    tbTableWidget.css({
        margin: "0 10px",
        background: "#1C242E"
    });

    const tbWidgetContent = $container.parents(".tb-widget-content");
    tbWidgetContent.css({
        overflow: "hidden"
    });

    const headerElement = tbWidgetContent.prev();
    headerElement.css({
        background: "#1C242E", 
        paddingTop: "30px",
        alignItems: "center"
    });

    const titleElement = headerElement.children().first();
    titleElement.css({
        padding: 0
    }).children().css({fontFamily: "TT Mussels"});

    const titleText = headerElement.find("*").filter(".tb-widget-title .title");
    // const titleText = $containerParent.find(".tb-widget-title .title");
    console.log({titleText});
    titleText.css({
        background: "#151319",
        borderTopRightRadius: 190,
        borderBottomRightRadius: 190,
        padding: "4px 25px 4px 12px",
        height: 32,
    });

    // Add styles to table header cells
    $container.find(".table-container table thead mat-header-row mat-header-cell").css({
        fontFamily: "TT Mussels",
        fontSize: "18px",
        fontWeight: "bold"
    });
    console.log($container.find(".table-container table tbody .mat-mdc-cell"));

    // console.log($container.find(".tb-table-widget .mat-mdc-paginator"))
    $container.find(".tb-table-widget .mat-mdc-paginator").children().css({
        fontFamily: "TT Mussels",
    });
    $container.find(".tb-table-widget .mat-mdc-paginator .mat-mdc-form-field .mat-mdc-select-value").css({
        fontFamily: "TT Mussels",
    });
    $container.find(".table-container table tbody .mat-mdc-cell").children().css({
        fontFamily: "TT Mussels",
        fontSize: "16px"
    });

    $container.find(".table-container .no-data-found").css({
        fontFamily: "TT Mussels",
    });
};

self.onInit = function() {
    handleWidgetStyles(self.ctx);
    console.log({ctx: self.ctx})
};

self.onDataUpdated = function() {
    self.ctx.$scope.alarmsTableWidget.onDataUpdated();
};

self.actionSources = function() {
    return {
        'actionCellButton': {
            name: 'widget-action.action-cell-button',
            multiple: true,
            hasShowCondition: true
        },
        'rowClick': {
            name: 'widget-action.row-click',
            multiple: false
        }
    };
};

self.onDestroy = function() {
};

